    return (
        <View style={{ background: "linear-gradient, #9198e5)" }}>
            <Image style={styles.photo} source={require('E:/Upwork/React Native/AwesomeProject/assets/Rectangle 5352.png')}></Image>
            <Text>Haines</Text>

        </View>
    )
}

const styles = StyleSheet.create({
    
    container: {
        borderRadius: 12,
        // backgroundColor: "linear-gradient(#FF9457, #E96114)"
    },
    
    photo: {
        width: 24,
        height: 24,
